// 로그인 재정의
setAppDataLogin = function(resData) {
	var custNo = resData.params.custNo;
	if (custNo == 'undefined' || custNo == '') {
		custNo = prompt("고객번호를 입력하세요");
	}
	var loginForm = makeForm("loginForm");
	addFormData(loginForm, "custNo", custNo);
	alert('${authFlag}');
	doAction("DEP0001"
			, loginForm
			, function(resData){
					AUTHORIZATION = resData.authorization;
					var reqJson = {
							"serviceCd" : "APP_DATA", 
							"params":{"gubun":"C", "reqData":{"authorization": AUTHORIZATION} }
					}
					ftBridgeExcutor.postMessage(reqJson);
			    }
			,function(){});
};

